INSERT INTO `jobs` (`id`, `title`, `position`, `company_name`, `category_id`, `vacancy`, `job_responsibility`, `employment_status`, `education_requirement`, `job_context`, `experience_requirement`, `additional_requirement`, `job_location`, `salary`, `other_benefits`, `email`, `status`, `lang`, `deadline`, `meta_tags`, `slug`, `meta_description`, `application_fee`, `application_fee_status`, `created_at`, `updated_at`) VALUES
(1, 'Junior WordPress Developer', 'Junior Developer', 'xgenious', '2', '6', 'We are looking for some experienced developers with fluency in WordPress who will be able to develop code for complex, data intensive Website and e-commerce application.', 'full_time', 'Preferably B.Sc. in Computer Science or similar discipline.', 'We`re building tomorrow`s platforms for consolidating and managing Enterprise data with process optimization. Most enterprises are adopting automation whether it`s about office or industry. The flexibility to automate the processes, without compromising security and compliance, will be one of the most challenging, yet key requirements in coming days. This is where SoftoPark comes into the picture.\r\nWe`re looking for someone with a portfolio that showcases relevant, high quality web development work. You`ll have strong mathematical and problem-solving capabilities, an eye for detail, and a desire to produce high quality, clean and efficient code.', 'At least 5 year(s)', 'Both males and females are allowed to apply\r\nMust have clear concept on OOP\r\nProven work experience in developing large scale enterprise WordPress applications\r\nMust have experience on complex plugin, widget, theme development\r\nMust have knowledge on upgradation policy, performance, security of WordPress\r\nExperience in MySQL, jQuery, and at least one PHP-based MVC framework is required\r\nExperience in one or more PHP-based content management systems Magento or any other eCommerce is a plus point\r\nExperience in different kind of service and gateway integration will be highly regarded\r\nExperience in version control (git, svn etc) is expected\r\nShould be team player, self-motivated and take responsibility proactively', 'Bangkok, Thailand', 'Negotiable', '2 annual performance bonuses\r\nHealth and life insurance\r\nBreakfast, Lunch, Snacks\r\n2 days of weekend and annual paid leaves\r\nPublic holidays\r\nPicnic/Tour\r\nTransport', NULL, 'publish', 'en_US', '2021-03-17', NULL, 'junior-wordpress-developer', NULL, NULL, NULL, '2020-07-20 19:19:22', '2021-03-18 13:44:48'),
(2, 'Senior Laravel Developer', 'Junior Developer', 'xgenious', '2', '6', 'We are looking for some experienced developers with fluency in WordPress who will be able to develop code for complex, data intensive Website and e-commerce application.', 'full_time', 'Preferably B.Sc. in Computer Science or similar discipline.', 'We`re building tomorrow`s platforms for consolidating and managing Enterprise data with process optimization. Most enterprises are adopting automation whether it`s about office or industry. The flexibility to automate the processes, without compromising security and compliance, will be one of the most challenging, yet key requirements in coming days. This is where SoftoPark comes into the picture.\r\nWe`re looking for someone with a portfolio that showcases relevant, high quality web development work. You`ll have strong mathematical and problem-solving capabilities, an eye for detail, and a desire to produce high quality, clean and efficient code.', 'At least 5 year(s)', 'Both males and females are allowed to apply\r\nMust have clear concept on OOP\r\nProven work experience in developing large scale enterprise WordPress applications\r\nMust have experience on complex plugin, widget, theme development\r\nMust have knowledge on upgradation policy, performance, security of WordPress\r\nExperience in MySQL, jQuery, and at least one PHP-based MVC framework is required\r\nExperience in one or more PHP-based content management systems Magento or any other eCommerce is a plus point\r\nExperience in different kind of service and gateway integration will be highly regarded\r\nExperience in version control (git, svn etc) is expected\r\nShould be team player, self-motivated and take responsibility proactively', 'Bangkok, Thailand', 'Negotiable', '2 annual performance bonuses\r\nHealth and life insurance\r\nBreakfast, Lunch, Snacks\r\n2 days of weekend and annual paid leaves\r\nPublic holidays\r\nPicnic/Tour\r\nTransport', NULL, 'publish', 'en_US', '2021-06-18', NULL, 'senior-laravel-developer', NULL, '80', 'on', '2020-07-20 19:22:07', '2021-03-18 13:44:48'),
(3, 'Graphic Designer', 'Junior Designer', 'xgenious', '3', '8', '<ul><li>Able to Design Logos, Banners, Brochure, PSD, Layout, Booklet relevant editing/retouching and digital marketing/media related works.\r\n</li><li>Innovative and skilled in design development including effective use of color, dimension, style, font size, and composition.\r\n</li><li>Must be expert in Adobe Photoshop, Adobe Illustrator, After Effects, Adobe In Design, Adobe Premiere Pro, Adobe Dreamweaver, PowerPoint and other related design/editing software.\r\n</li><li>Perform technical duties for designing and developing multimedia-based layouts, graphics, animation, video, online tutorials and other digital marketing related productions.\r\n</li><li>Understanding client\'s business problem, brand space, target audience and the overall creative strategy.\r\n</li><li>Maintaining the highest standards in graphic design and producing cutting-edge creative content for both digital marketing and social media marketing that accurately represents the expectations of the client.\r\n</li><li>Any other task assigned by management.</li></ul>', 'part_time', 'Diploma in Graphics Design or equivalent', 'Place of work : Head office, Dhanmondi R/A, Dhaka\r\nDuty : Saturday to Thursday - Time 9:30 AM to 6:00 PM', 'At least 3 year(s)', '<ul><li>Age 20 to 35 years</li><li>\r\nBoth males and females are allowed to apply\r\n</li><li>Ready to work in a team and in line with the Management instruction as and when required.\r\n</li><li>Troubleshoot, test, and analyze ideas to provide the creative solution.\r\n</li><li>Eye for typography, composition, layout, color, high-quality production with pixel-level attention to detail.\r\n</li><li>Experience with content management platforms.\r\n</li><li>Strong interpersonal and professional skills.\r\n</li><li>A deep sense of developing a BRAND with international standard.</li></ul>', 'Bangkok, Thailand', 'Negotiable', '<ul><li>Mobile bill\r\nSalary </li><li>Review: Yearly\r\n</li><li>Festival Bonus: 2\r\n</li><li>Lunch Facilities</li></ul>', NULL, 'publish', 'en_US', '2021-09-29', NULL, 'graphic-designer', NULL, '150', 'on', '2020-07-20 19:22:11', '2021-06-01 10:31:44'),
(4, 'Sr. Executive (Accounts)', 'Junior Accounts', 'xgenious', '1', '6', 'Ensures the integrity of accounting information by recording, verifying, consolidating, and entering transactions.\r\nPrepares and records asset, liability, revenue, and expenses entries by compiling and analyzing account information.\r\nMaintains and balances subsidiary accounts by verifying, allocating, posting, and reconciling transactions and resolving discrepancies.\r\nMaintains general ledger by transferring subsidiary accounts, preparing a trial balance, and reconciling entries.Overall responsible for Accounts & Finance.\r\nExecute the financial strategy of the company\r\nManage financial controls and accounting procedures\r\nEnsure full transparency over the financial performance of the company\r\nSummarizes financial status by collecting information and preparing balance sheet, profit and loss, and other statements.\r\nProduces payroll by initiating computer processing; printing checks, verifying finished product.\r\nCompletes external audit by analyzing and scheduling general ledger accounts and providing information for auditors.\r\nAvoids legal challenges by complying with legal requirements.\r\nSecures financial information by completing database backups.\r\nProtects organization\'s value by keeping information confidential.To carry out any other assignment given by the company or immediate superior.\r\nSubmit a report on monthly basis about the sales, production and stock.\r\nMonitoring of all the necessary paperwork by all departments.\r\nResponsible for overall Accounts & Finance related mater in plant.\r\nOthers task assign by the departmental head / management.', 'project_based', 'Master of Business Administration (MBA) in Accounting\r\nSkills Required: Accounting and Finance', 'Kishoreganj Eye Hospital operated by a non-government organization named Nari Uddug Kendra (NUK) is well established and reputed modern eye hospital which is working for eradicating the avoidable blindness from Bangladesh and as well as to meet up the VISION-2020 goal of WHO. Kishoreganj Eye Hospital here noticed to recruit for the Post of Senior Accounts Officer as full-time basis.', 'At least 3 year(s)\r\nThe applicants should have experience in the following area(s):\r\nAccountant\r\nThe applicants should have experience in the following business area(s):\r\nReal Estate', 'Age 28 to 35 years\r\nBoth males and females are allowed to apply\r\nGood Command in Excel and Word.\r\nApplicant must have work experience & sound working capacity on Tally Software.\r\nMinimum 3-5 years\' experience in accounting/finance\r\nExperience with financial reporting requirements\r\nHave mentality to work in stress & long hours.\r\nGood computer knowledge must be required (with tally software).', 'Bangkok, Thailand', 'Negotiable', 'According to Company Policy', NULL, 'publish', 'en_US', '2021-07-28', NULL, 'sr-executive-accounts', NULL, NULL, 'on', '2020-07-20 19:22:14', '2021-03-18 13:44:48'),
(6, 'تنفيذي أول (الحسابات)', 'حسابات الصغار', 'xgenious', '11', '6', 'يضمن سلامة المعلومات المحاسبية من خلال تسجيل المعاملات والتحقق منها ودمجها وإدخالها.\r\nإعداد وتسجيل إدخالات الأصول والالتزامات والإيرادات والنفقات عن طريق تجميع وتحليل معلومات الحساب.\r\nيحتفظ بأرصدة الحسابات الفرعية ويوازنها من خلال التحقق من المعاملات وتخصيصها ونشرها وتسويتها وحل التناقضات.\r\nيحتفظ بدفتر الأستاذ العام عن طريق تحويل الحسابات الفرعية ، وإعداد ميزان المراجعة ، ومطابقة الإدخالات.\r\nتنفيذ الإستراتيجية المالية للشركة\r\nإدارة الضوابط المالية والإجراءات المحاسبية\r\nضمان الشفافية الكاملة في الأداء المالي للشركة\r\nيلخص الوضع المالي من خلال جمع المعلومات وإعداد الميزانية العمومية والأرباح والخسائر والبيانات الأخرى.\r\nتنتج كشوف المرتبات من خلال بدء معالجة الكمبيوتر ؛ فحص الطباعة ، والتحقق من المنتج النهائي.\r\nيكمل التدقيق الخارجي عن طريق تحليل وجدولة حسابات دفتر الأستاذ العام وتوفير المعلومات للمراجعين.\r\nيتجنب التحديات القانونية من خلال الامتثال للمتطلبات القانونية.\r\nيؤمن المعلومات المالية من خلال استكمال النسخ الاحتياطية لقاعدة البيانات.\r\nيحمي قيمة المنظمة من خلال الحفاظ على سرية المعلومات ، للقيام بأي مهمة أخرى تقدمها الشركة أو الرئيس المباشر.\r\nتقديم تقرير شهري عن المبيعات والإنتاج والمخزون.\r\nمراقبة جميع الأوراق اللازمة من قبل جميع الإدارات.\r\nمسؤول عن مجمل الحسابات والتمويل المتعلق بالمواد في المصنع.\r\nمهمة أخرى يسندها رئيس / إدارة القسم.', 'part_time', 'ماجستير إدارة الأعمال (MBA) في المحاسبة\r\nالمهارات المطلوبة: المحاسبة والمالية', 'مستشفى Kishoreganj للعيون الذي تديره منظمة غير حكومية تُدعى Nari Uddug Kendra (NUK) هو مستشفى عيون حديث ومعروف جيدًا يعمل على القضاء على العمى الذي يمكن تجنبه من بنغلاديش وكذلك لتحقيق هدف VISION-2020 لمنظمة الصحة العالمية. لاحظ مستشفى Kishoreganj للعيون هنا أن يوظف في وظيفة مسؤول حسابات أول بدوام كامل.', '3 سنوات على الأقل\r\nيجب أن يكون لدى المتقدمين خبرة في المجالات التالية:\r\nمحاسب\r\nيجب أن يكون لدى المتقدمين خبرة في مجالات الأعمال التالية:\r\nالعقارات', 'العمر من 28 إلى 35 سنة\r\nيسمح لكل من الذكور والإناث بتقديم الطلبات\r\nأمر جيد في Excel و Word.\r\nيجب أن يكون لدى المتقدم خبرة عمل وقدرة عمل سليمة على برنامج Tally.\r\nخبرة لا تقل عن 3-5 سنوات في المحاسبة / المالية\r\nالخبرة بمتطلبات إعداد التقارير المالية\r\nلديه عقلية للعمل في الضغط وساعات طويلة.\r\nيجب أن تكون المعرفة الجيدة بالكمبيوتر مطلوبة (باستخدام برنامج tally).', 'بانكوك، تايلند', 'قابل للتفاوض', 'وفقًا لسياسة الشركة', NULL, 'publish', 'ar', '2020-08-14', NULL, 'tnfythy-aol-alhsabat', NULL, NULL, NULL, '2020-07-20 19:39:50', '2021-03-18 13:55:12'),
(13, 'كبير مطوري Laravel', 'مطور مبتدئ', 'xgenious', '11', '6', 'نحن نبحث عن بعض المطورين ذوي الخبرة بطلاقة في WordPress الذين سيكونون قادرين على تطوير رمز لموقع ويب معقد ومكثف للبيانات وتطبيق التجارة الإلكترونية.', 'full_time', 'يفضل بكالوريوس في علوم الكمبيوتر أو تخصص مماثل.', 'نحن بصدد إنشاء منصات غدًا لدمج وإدارة بيانات المؤسسة من خلال تحسين العمليات. معظم الشركات تعتمد الأتمتة سواء كان الأمر يتعلق بالمكتب أو الصناعة. ستكون المرونة لأتمتة العمليات ، دون المساس بالأمن والامتثال ، أحد المتطلبات الأكثر تحديًا ، ولكن الرئيسية في الأيام القادمة. هذا هو المكان الذي يأتي فيه SoftoPark إلى الصورة.\r\nنحن نبحث عن شخص لديه محفظة تعرض أعمال تطوير الويب ذات الصلة والجودة العالية. سيكون لديك قدرات رياضية قوية وحل المشكلات ، وعين على التفاصيل ، ورغبة في إنتاج كود عالي الجودة ونظيف وفعال.', '5 سنوات على الأقل', 'يسمح لكل من الذكور والإناث بتقديم الطلبات\r\nيجب أن يكون لديك مفهوم واضح على OOP\r\nأثبتت خبرة العمل في تطوير تطبيقات WordPress للمؤسسات على نطاق واسع\r\nيجب أن يكون لديك خبرة في البرنامج المساعد المعقدة ، القطعة ، تطوير السمة\r\nيجب أن يكون لديك معرفة بسياسة الترقية والأداء وأمن WordPress\r\nمطلوب خبرة في MySQL و jQuery وإطار عمل MVC قائم على PHP واحد على الأقل\r\nالخبرة في واحد أو أكثر من أنظمة إدارة المحتوى القائمة على PHP Magento أو أي تجارة إلكترونية أخرى هي نقطة زائد\r\nستحظى الخبرة في أنواع مختلفة من الخدمة وتكامل البوابة بتقدير كبير\r\nمن المتوقع خبرة في التحكم في الإصدار (git ، svn إلخ)\r\nيجب أن يكون لاعب الفريق ، بدافع ذاتي وتحمل المسؤولية بشكل استباقي', 'Bangkok, Thailand', 'قابل للتفاوض', '2 مكافآت أداء سنوية\r\nالتأمين الصحي والتأمين على الحياة\r\nالإفطار والغداء والوجبات الخفيفة\r\nيومان من عطلة نهاية الأسبوع والإجازات السنوية مدفوعة الأجر\r\nإجازات رسمية\r\nنزهة / جولة\r\nالمواصلات', NULL, 'publish', 'ar', '2020-08-22', NULL, 'kbyr-mtory-laravel', NULL, NULL, NULL, '2020-07-20 20:44:59', '2021-03-18 13:55:12');
